Протектора́т (лат. protector — покровитель) — форма межгосударственных отношений, при которой одно государство находится под защитой (в первую очередь, военной) другого государства. Протекторатом также называется защищаемое государство. Государство, осуществляющее протекторат, называется протектором. При этом суверенитет патронируемого государства частично делегируется протектору: патронируемое государство практически не суверенно во внешнеполитических делах при значительном суверенитете во внутренних делах (в частности, сохраняется форма правления и местное национальное правительство). Протекторат представляет собой разновидность клиентского государства и имеет общие черты с вассальным государством и марионеточным государством, но от первого отличается большим контролем со стороны патронирующего государства, а от второго — наличием официального статуса. Примеры протектората: 
* Протектораты Османской Империи в XVI—XIX веках: Крымское ханство, Алжир, Триполитания; 
* Речь Посполитая в 1768—1791 и в 1793—1794 годах, под протекторатом России; 
* Картли-Кахетинское царство в 1786—1801 годах, под протекторатом России; 
* Рейнский союз — заключённый под давлением Наполеона I в 1806 году в Париже союз немецких монархий, вышедших из состава Священной Римской империи; 
* Индия Великих Моголов в 1803—1858 годах, под протекторатом Великобритании; 
* Младший жуз Казахского ханства, под протекторатом Российской империи. 
* Карачай в 1828—1834 годах (де-факто) под протекторатом России, а в 1834—1873 годах — де-юре. Британскими протекторатами также были Бахрейн, Бечуаналенд (совр. Ботсвана), Аден, Бутан, Уганда и др. После Первой мировой войны возник особый тип протектората — подмандатная территория Лиги Наций. В отличие от государства-протектората, государство, которому выдавался мандат, было ограничено обязательством перед Лигой Наций; часть подмандатных территорий фактически не имели суверенитета во внутренних делах и полностью управлялись получившим мандат государством. Таковыми являлись: Сирия, Ливан, Палестина, Трансиордания, Ирак, Того, Камерун, Юго-Западная Африка, Руанда-Урунди, Танганьика, Маршалловы острова, Западное Самоа, Науру. Протекторат Богемии и Моравии в 1939—1945, зависящий от нацистской Германии, вопреки названию де-факто был классическим марионеточным государством. В настоящее время своеобразным аналогом протектората является ассоциированное государство.
